import React from 'react';

const DashboardUser = () => {
  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-4">User Dashboard</h1>
      <p className="text-gray-700">Browse stores, rate them, and manage your profile.</p>
    </div>
  );
};

export default DashboardUser;
